import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
    const title = 'React Coin';
    return (
        <div>


            <h1>{title}</h1>
            <p>Crypto Currencies Financial Data</p>

        </div>
    );
};

ReactDOM.render(

    <App />,
    document.getElementById('root')
);
